import React, {Component} from 'react'

export default class Ingresar extends Component{
  constructor(props){
    let ingreso = false
    this.state = {
      nombreUsuario: '',
      password: '',
      ingreso
    }
  }
  render(){
    return (
      <div>
          <h1>Login</h1>
        <form onSubmit={this.submitForm}>
          <input type= "text" placeholder="nombreUsuario" name="nombreUsuario" value="this.state.nombreUsuario"></input>
          <br/>
          <input type= "password" placeholder="password" name="password" value="this.state.password"></input>
          <br/>
          <input type="submit"></input>
        </form>
      </div>
    )
  }
}
